import React, { useEffect, useState } from 'react';
import './App.css';

import Header from './Header';
import { CategoryList } from './Types/Interface';
import { getCategoryRequest } from './Apis';
import GetCategoryResponseDto from './Apis/Response/getCategoryResponse.dto';




function App() {

    const [categoryData, setCategoryData] = useState<CategoryList[]>([])



const getCategoryResponse =(responseBody:GetCategoryResponseDto |null|undefined)=>{
    console.log(responseBody);
        if(!responseBody) return;

        const {Category}=responseBody as GetCategoryResponseDto;
        setCategoryData(Category);
      }

useEffect(()=>{
 getCategoryRequest().then(getCategoryResponse)

},[])

return (
    <>
       {categoryData.length > 0 ? 
          categoryData.map(data => <Header key={data.categoryId} categoryListItem={data} />) :
          <div>데이터 없음</div>
       }
       <div>Main 화면 렌더링 부분</div>
    </>
 );

}
export default App;
